import React from 'react'

function NoteItem(props) {
    const { note } = props
    return (
        <div>
            {note.title}
            {note.description}
            <div class="card">
                <div class="card-body">
                    <h5 class="card-title">{note.title}</h5>
                    <p class="card-text">{note.description}</p>
                    <a href="#" class="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        </div>
    )
}

export default NoteItem
